CREATE TABLE facilities 
(
    facility_code	VARCHAR(512),
    facility_name	VARCHAR(512),
    province	VARCHAR(512),
    county	VARCHAR(512),
    district	VARCHAR(512),
    division	VARCHAR(512),
    type	VARCHAR(512),
    owner	VARCHAR(512),
    location	VARCHAR(512),
    sub_location	VARCHAR(512),
    Description_of_location	VARCHAR(512),
    constituency	VARCHAR(512),
    nearest_town	VARCHAR(512)
);
    
